import 'dart:convert';

int run() {
  var ls = LineSplitter();
  var m = ls.convert(inp);
  var size = m.length;

  var occ = 0;

  for (var x = 1; x < size - 1; x++) {
    for (var y = 1; y < size - 1; y++) {
      if (m[y][x] == "A") {
        var bs = "${m[y-1][x-1]}${m[y+1][x+1]}";
        var fs = "${m[y-1][x+1]}${m[y+1][x-1]}";
        if ((bs == "SM" || bs == "MS") && (fs == "SM" || fs == "MS")) {
          occ++;
        }
      }
    }
  }

  return occ;
}

